/// <summary>
/// Returns the flag field Id for a given <c>InventDimension</c> class.
/// </summary>
/// <param name = "_dimensionClassName">The name of the <c>InventDimension</c> class.</param>
/// <returns>The flag field Id.</returns>
static protected FieldId getFlagFieldIdForDimension(ClassName _dimensionClassName)
{
    FieldId fieldIdOnInventDimParm = InventDimParm::fieldIdForDimension(_dimensionClassName);
    return InventSumDeltaDim::dimParm2SumDeltaDimFlag(fieldIdOnInventDimParm);
}

/// <summary>
/// Convert the provided <c>InventDimParm</c> field to a corresponding flag field id on <c>InventSumDeltaDim</c> table.
/// </summary>
/// <param name = "_dimParmField">Dimension flag field Id on <c>InventDimParm</c> table.</param>
/// <returns>Dimension flag field Id on <c>InventSumDeltaDim</c> table.</returns>
static public FieldId dimParm2SumDeltaDimFlag(FieldId _dimParmField)
{
    #InventDimDevelop

    switch (_dimParmField)
    {
        case fieldNum(InventDimParm, ConfigIdFlag)         : return fieldNum(InventSumDeltaDim, ConfigIdFlag);
        case fieldNum(InventDimParm, InventSizeIdFlag)     : return fieldNum(InventSumDeltaDim, InventSizeIdFlag);
        case fieldNum(InventDimParm, InventColorIdFlag)    : return fieldNum(InventSumDeltaDim, InventColorIdFlag);
        case fieldNum(InventDimParm, InventStyleIdFlag)    : return fieldNum(InventSumDeltaDim, InventStyleIdFlag);
        case fieldNum(InventDimParm, InventVersionIdFlag)  : return fieldNum(InventSumDeltaDim, InventVersionIdFlag);
        case fieldNum(InventDimParm, InventSiteIdFlag)     : return fieldNum(InventSumDeltaDim, InventSiteIdFlag);
        case fieldNum(InventDimParm, InventLocationIdFlag) : return fieldNum(InventSumDeltaDim, InventLocationIdFlag);
        case fieldNum(InventDimParm, InventBatchIdFlag)    : return fieldNum(InventSumDeltaDim, InventBatchIdFlag);
        case fieldNum(InventDimParm, wmsLocationIdFlag)    : return fieldNum(InventSumDeltaDim, wmsLocationIdFlag);
        case fieldNum(InventDimParm, InventSerialIdFlag)   : return fieldNum(InventSumDeltaDim, InventSerialIdFlag);
        case fieldNum(InventDimParm, LicensePlateFlag)     : return fieldNum(InventSumDeltaDim, LicensePlateFlag);
        case fieldNum(InventDimParm, InventStatusFlag)     : return fieldNum(InventSumDeltaDim, InventStatusFlag);

        case fieldNum(InventDimParm, InventDimension1Flag) : return fieldNum(InventSumDeltaDim, InventDimension1Flag);
        case fieldNum(InventDimParm, InventDimension2Flag) : return fieldNum(InventSumDeltaDim, InventDimension2Flag);
        case fieldNum(InventDimParm, InventDimension3Flag) : return fieldNum(InventSumDeltaDim, InventDimension3Flag);
        case fieldNum(InventDimParm, InventDimension4Flag) : return fieldNum(InventSumDeltaDim, InventDimension4Flag);
        case fieldNum(InventDimParm, InventDimension5Flag) : return fieldNum(InventSumDeltaDim, InventDimension5Flag);
        case fieldNum(InventDimParm, InventDimension6Flag) : return fieldNum(InventSumDeltaDim, InventDimension6Flag);
        case fieldNum(InventDimParm, InventDimension7Flag) : return fieldNum(InventSumDeltaDim, InventDimension7Flag);
        case fieldNum(InventDimParm, InventDimension8Flag) : return fieldNum(InventSumDeltaDim, InventDimension8Flag);
        case fieldNum(InventDimParm, InventDimension9Flag) : return fieldNum(InventSumDeltaDim, InventDimension9Flag);
        case fieldNum(InventDimParm, InventDimension10Flag): return fieldNum(InventSumDeltaDim, InventDimension10Flag);
        case fieldNum(InventDimParm, InventDimension11Flag): return fieldNum(InventSumDeltaDim, InventDimension11Flag);
        case fieldNum(InventDimParm, InventDimension12Flag): return fieldNum(InventSumDeltaDim, InventDimension12Flag);

        // <GEERU>
        case fieldNum(InventDimParm, InventGTDIdFlag_RU)    : return fieldNum(InventSumDeltaDim, InventGTDIdFlag_RU);
        case fieldNum(InventDimParm, InventProfileIdFlag_RU): return fieldNum(InventSumDeltaDim, InventProfileIdFlag_RU);
        case fieldNum(InventDimParm, InventOwnerIdFlag_RU)  : return fieldNum(InventSumDeltaDim, InventOwnerIdFlag_RU);
        // </GEERU>
    }

    throw error(strFmt("@SYS54431", funcName()));
}

public void initFromInventDimParm(InventDimParm _inventDimParm)
{
    Enumerator enumerator = InventDimParm::dimParmEnabledFieldList().getEnumerator();

    while (enumerator.moveNext())
    {
        FieldId dimParmFieldId = enumerator.current();
        FieldId inventSumDeltaDimFlagFieldId = InventSumDeltaDim::dimParm2SumDeltaDimFlag(dimParmFieldId);
        this.(inventSumDeltaDimFlagFieldId) = _inventDimParm.(dimParmFieldId);
    }
}

public void initInventDim(InventDim _inventDim)
{
    _inventDim.InventDimFieldsMap::initAllDimensionsFrom(this);
    // <GEERU>
    _inventDim.InventGtdId_RU     = this.InventGTDId_RU;
    _inventDim.InventProfileId_RU = this.InventProfileId_RU;
    _inventDim.InventOwnerId_RU   = this.InventOwnerId_RU;
    // </GEERU>
}

/// <summary>
///    Establishes the association to the InventDim table and stores information on whether the associated dimension combination
///    contains values for all active dimensions.
/// </summary>
/// <param name="_inventDim">
///    An <c>InventDim</c> buffer containing the dimension combination the current record must establish a relationship to.
/// </param>
/// <param name="_inventDimGroupSetup">
///    An instance of the <c>InventDimGroupSetup</c> class that provides information about the dimension setup
///    for the item associated with the current record.
/// </param>
/// <param name="_inventDimParm">
///    An <c>InventDimParm</c> buffer describing for which dimensions the _inventDim parameter contain values.
/// </param>
public void setInventDimRelation(InventDim _inventDim, InventDimGroupSetup _inventDimGroupSetup, InventDimParm _inventDimParm)
{
    InventDimParm   activeInventDimParm;

    this.InventDimId = InventDim::findOrCreate(_inventDim).InventDimId;

    _inventDimGroupSetup.inventDimParmActive(activeInventDimParm);
    this.AreAllActiveDimensionsSpecified = InventDimParm::isInventDimParmEqual(_inventDimParm, activeInventDimParm);
}
